ng to Jason Fitzgerald, you need to learn to love strength training, too. Fitzgerald, a longtime runner and USAFT-certified running coach (and Greatist Expert!), wants to teach runners how to achieve their goals and prevent injuries through specialized workouts, recovery techniques, and strength exercises. Strength Running is a must-read site for any runner with a history of injuries (or any runner who wants to avoid an injury in the future).'),(403,617,'_additional_content','field_534e3674cc14b'),(404,617,'reference_image_one','1078'),(405,617,'_reference_image_one','field_533d3e46f9e13'),(406,617,'reference_image_two','1074'),(407,617,'_reference_image_two','field_533d3e65f9e14'),(408,617,'sharing_buttons','a:4:{i:0;s:8:\"facebook\";i:1;s:7:\"twitter\";i:2;s:9:\"pinterest\";i:3;s:11:\"google-plus\";}'),(409,617,'_sharing_buttons','field_53c3b621d4031'),(410,617,'gallery-images','1000'),(411,617,'gallery-images','1068'),(412,617,'gallery-images','1070'),(413,617,'portfolio-single-type','0'),(414,617,'_',''),(415,626,'_edit_last','1'),(416,626,'element_style','Square'),(417,626,'_element_style','field_533fee0e9e98b'),(418,626,'masonry_size','Small'),(419,626,'_masonry_size','field_533ab81e35650'),(420,626,'video_iframe','<iframe src=\"//player.vimeo.com/video/91961306\" width=\"500\" height=\"281\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>'),(421,626,'_video_iframe','field_533cff1922bb6'),(422,626,'additional_content','Adipiscing, mus enim lectus sagittis, magna, est amet, urna cras nisi risus aliquet tincidunt ridiculus mauris adipiscing adipiscing tristique cras. Nec pulvinar natoque integer! Aliquet et, integer placerat, nunc elementum enim lorem. Nisi tincidunt urna! Odio? Adipiscing diam nisi nunc adipiscing a dis nec hac, non in placerat mauris proin. In, tortor! Vel in lorem porta. Mus in, nunc rhoncus dis lorem dolor porta sagittis porttitor? Adipiscing lorem, facilisis purus sed et! Odio et diam aenean nascetur soc