insert  into `xwp_posts` values (1,1,'2015-08-31 19:07:02','2015-08-31 19:07:02','Bienvenido a WordPress. Esta es tu primera entrada. Edítala o bórrala, ¡y comienza a escribir!','¡Hola mundo!','','publish','open','open','','hola-mundo','','','2015-08-31 19:07:02','2015-08-31 19:07:02','',0,'http://xpertos.com.co/paginaweb/?p=1',0,'post','',1),(2,1,'2015-08-31 19:07:02','2015-08-31 19:07:02','Esto es una página de ejemplo. Es diferente a una entrada porque permanece fija en un lugar y se mostrará en la navegación de tu sitio (en la mayoría de los temas). La mayoría de la gente empieza con una página de Acerca de, que les presenta a los potenciales visitantes del sitio. Podría ser algo como esto:\n\n<blockquote>¡Hola! Soy mensajero por el día, aspirante a actor por la noche, y este es mi blog. Vivo en Madrid, tengo un perrazo llamado Duque y me gustan las piñas coladas (y que me pille un chaparrón)</blockquote>\n\n...o algo así:\n\n<blockquote>La empresa XYZ se fundó en 1971 y ha estado ofreciendo \"cosas\" de calidad al público desde entonces. Situada en Madrid, XYZ emplea a más de 2.000 personas y hace todo tipo de cosas sorprendentes para la comunidad de Madrid.</blockquote>\n\nSi eres nuevo en WordPress deberías ir a <a href=\"http://xpertos.com.co/paginaweb/wp-admin/\">tu escritorio</a> para borrar esta página y crear páginas nuevas con tu propio contenido. ¡Pásalo bien!','Página de ejemplo','','publish','open','open','','pagina-ejemplo','','','2015-08-31 19:07:02','2015-08-31 19:07:02','',0,'http://xpertos.com.co/paginaweb/?page_id=2',0,'page','',0),(1230,1,'2015-09-01 02:56:48','2015-09-01 02:56:48','<p>Nombre (requerido)<br />\n    [text* your-name] </p>\n\n<p>Correo electrónico (requerido)<br />\n    [email* your-email] </p>\n\n<p>Asunto<br />\n    [text your-subject] </p>\n\n<p>Mensaje<br />\n    [textarea your-message] </p>\n\n<p>[submit \"Enviar\"]</p>\n[your-subject]\n[your-name] <wordpress@xpertos.com.co>\nDe: [your-name] <[your-email]>\nAsunto: [your-subject]\n\nCuerpo del mensaje:\n[your-message]\n\n--\nEste mensaje se ha enviado vía formulario de contacto desde Xpertos.com.co (http://xpertos.com.co/paginaweb)\ncbatz@baumdecolombia.com\nReply-To: [your-email]\n\n0\n0\n\n[your-subject]\nXpertos.com.co <wordpress@xpertos.com.co>\nCuerpo del mensaje:\n[your-message]\n\n--\nEste mensaje se ha enviado vía formulario de contacto desde Xpertos.com.co (http://xpertos.com.co/paginaweb)\n[your-email]\nReply-To: cbatz@baumdecolombia.com\n\n0\n0\nSu mensaje se ha enviado con éxito. Muchas gracias.\nFalló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\nOcurrió un error de validación. Por favor, confirme los campos y envíe el formulario de nuevo.\nFalló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\nPor favor, acepte los términos y condiciones para continuar.\nPor favor, complete el campo requerido.\nEsta entrada es demasiado grande.\nEsta entrada es demasiado corta.','Formulario de contacto 1','','publish','closed','closed','','formulario-de-contacto-1','','','2015-09-01 02:56:48','2015-09-01 02:56:48','',0,'http://xpertos.com.co/paginaweb/?post_type=wpcf7_contact_form&p=1230',0,'wpcf7_contact_form','',0),(1037,1,'2014-07-14 14:00:10','2014-07-14 14:00:10','3821','Published Apps','','publish','closed','closed','','published-apps','','','2014-07-14 14:00:10','2014-07-14 14:00:10','',0,'http://ava-themes.com/WP/AthleticaDummy/?post_type=agency-slider&amp;p=1037',0,'agency-slider','',0),(1038,1,'2014-07-14 14:04:45','2014-07-14 14:04:45','381','Lines of Code','','publish','closed','closed','','lines-of-code','','','2014-07-14 14:04:45','2014-07-14 14:04:45','',0,'http://ava-themes.com/WP/AthleticaDummy/?post_type=agency-slider&amp;p=1038',0,'agency-slider','',0),(1039,1,'2014-07-14 14:05:03','2014-07-14 14:05:03','1821','Satisfied Clients','','publish','closed','closed','','satisfied-clients','','','2014-07-14 14:05:03','