m/whos-taking-care-of-you\" target=\"_blank\">For Women: Is Taking Care of Yourself Really That Selfish?</a> ” and “<a href=\"http://www.precisionnutrition.com/busy-mans-guide\" target=\"_blank\">The Busy Man’s Guide to Getting In Shape</a> .”\n\nOur favorite <a href=\"http://greatist.com/health/fistbumping-handshake-video-12/13/13\" target=\"_blank\">fist-bumping doctor</a> doesn’t just write about why we should ditch handshakes for good. Hamblin’s a Senior Editor at The Atlantic, where he writes about gluten, anxiety, caffeine, babies, multivitamins, sex, HIV, cats, autism, and… we think you get the picture. Hamblin publishes a new column nearly every day and, given his interest in all types of health (including mental, physical, and sexual), we don’t expect him to run out of material anytime soon.','NPR’s The Salt','','publish','open','open','','nprs-the-salt','','','2014-04-16 08:06:22','2014-04-16 08:06:22','',0,'http://ava-themes.com/WP/Athletica/?p=617',0,'post','',0),(626,1,'2014-04-16 08:11:53','2014-04-16 08:11:53','Integer lundium purus mauris platea pellentesque porta? Placerat. Nec scelerisque in? In urna sed purus nascetur nisi phasellus vut aliquam mus facilisis nunc? Ac amet mid, augue! Mid tortor? Massa placerat? Rhoncus! Elementum urna! Porttitor, montes turpis mid odio auctor arcu sed integer ac.\n\nPurus scelerisque in dolor massa, sagittis ac, mauris phasellus adipiscing phasellus. Turpis! Etiam porttitor nunc, sit adipiscing phasellus montes dapibus odio in, non lorem. Ac diam montes. Mid vel ut! Cum a nisi elementum, lundium amet tortor sit. Velit. Habitasse risus, egestas duis in porta et! Ut facilisis? Sit ut lacus. Porttitor in amet in? Ac cum tincidunt lorem? Magna aliquet lectus phasellus aenean placerat nec sociis pellentesque aliquet eu, ut, et pellentesque lundium et.\n\nAmet elementum aliquet! Porttitor nisi, eu lacus nunc. Porta et lundium porttitor placerat. Turpis elit ac facilisis in velit porta rhoncus arcu cras, et, in adipiscin