d praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?</span>','Body Love Wellness','But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born.','publish','closed','closed','','body-love-wellness','','','2014-04-17 09:29:06','2014-04-17 09:29:06','',0,'http://ava-themes.com/WP/Athletica/?post_type=portfolio&amp;p=905',1,'portfolio','',0),(911,1,'2014-04-17 09:34:58','2014-04-17 09:34:58','<span style=\"color: #000000;\">On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.</span>\n\n<span style=\"color: #000000;\">On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.</span>','MindBodyGreen','On the other hand, we denounce with righteous indignation and dislike men who are so beguiled.','publish','closed','closed','','mindbodygreen','','','2014-04-17 09:34:58','2014-04-17 09:34:58','',0,'http://ava-themes.com/WP/Athletica/?post_type=portfolio&amp;p=911',7,'portfolio','',0),(942,1,'2014-04-16 07:04:25','2014-04-16 07:04:25','Our favorite fist-bumping doctor doesn’t just write about why we should ditch handshakes for good. Hamblin’s a Senior Editor at The Atlantic, where he writes about gluten, anxiety, caffeine, babies, multivitamins, sex, HIV, cats, autism, and… we think you get the picture. Hamblin publishes a new column nearly every day and, given his interest in all types of health (including mental, physical, and sexual), we don’t expect him to run out of material anytime soon.\n\nWith beautifully styled, <a href=\"http://q.equinox.com/articles/2014/01/heavy-lifting-video\" target=\"_blank\">fashion-editorial worthy</a>  photos and videos and plenty of celebrity endorsements, the luxurious Equinox gym chain uses its website to make health and fitness pretty darn sexy. The blog covers lifestyle topics as well as fitness, with tips on <a href=\"http://q.equinox.com/articles/2014/01/apartment-therapy\" target=\"_blank\">healthifying your home</a>  and ideas for outside-the-box <a href=\"http://q.equinox.com/articles/2014/01/winter-sports\" target=\"_blank\">winter vacations</a> .\n\nWhy do many people find <a href=\"http://www.npr.org/blogs/thesalt/2014/01/15/262741403/why-sugar-makes-us-feel-so-good\" target=\"_blank\">sugar irresistible</a> ? What are “<a href=\"http://www.npr.org/blogs/thesalt/2014/01/20/263510533/how-food-hubs-are-helping-new-farmers-break-into-local-food\" target=\"_blank\">food hubs</a> ” and why are they important? What’s the latest food trend? These are just a few of the questions asked every day on NPR’s food blog, The Salt. The blog covers everything related to eating, including food trends, food science, and food production, with NPR’s signature all-encompassing scope and attention to detail. Plus, there’s plenty of humor. One favorite column is <a href=\"http://www.npr.org/blogs/thesalt/162947372/sandwich-monday\" target=\"_blank\">Sandwich Monday</a>  (<a href=\"http://www.npr.org/blogs/thesalt/2013/03/25/175267907/sandwich-monday-the-mccamembert\" target=\"_blank\">McCamembert</a> , anyone?), where members of the NPR newsroom try out famous local lunches, often with ridiculous results.','Mark’s Daily Apple','','publish','open','open','','marks-daily-apple','','','2014-04-16 07:04:25','2014-04-16 07:04:25','',0,'http://ava-themes.com/WP/Athletica/?p=1',0,'post','',0),(943,1,'2014-04-17 09:37:18','2014-04-17 09:37:18','<span style=\"color: #000000;\">At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat.</span>\n\n<span style=\"color: #000000;\">At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat.</span>','Zen Habits','At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti.','publish','clo